 * ______________________
 * FETCH - /
 * ADD - /add
 * UPDATE - /update/:companyId
 * DELTE - /delete/:companyId
 * 
 * NOTE: 
 * 1. Use data.content to see the info of the docs
 * 2. Use data.message to see what has happened
