var _require = require('../controller/CompanyContoller'),
  get_company = _require.get_company,
  add_company = _require.add_company,
  update_company = _require.update_company,
  delete_company = _require.delete_company;
router.get("/", get_company);
router.post("/add", add_company);
router.patch("/update/:companyId", update_company);
router["delete"]("/delete/:companyId", delete_company);
module.exports = router;
