"use strict";

/**
 * Booking Register ROUTES
 * ______________________
 * FETCH - /:companyId  
 * ADD - /add/:companyId
 * UPDATE - /update/:bookingRegisterId
 * DELTE - /delete/:companyId/:bookingRegisterId
 * 
 * NOTE: 
 * 1. Use data.content to see the info of the docs
